import React, { Component } from 'react';

class Modal extends Component {
	state = {};
	render() {
		return (
			<div>
				<Modal.Dialog>
					<Modal.Header>
						<Modal.Title>Modal title</Modal.Title>
					</Modal.Header>

					<Modal.Body>One fine body...</Modal.Body>

					<Modal.Footer>
						<Button>Close</Button>
						<Button bsStyle="primary">Save changes</Button>
					</Modal.Footer>
				</Modal.Dialog>
			</div>
		);
	}
}

export default Modal;
